# Rosta, Republic of Dagestan

}}
Rosta (; ) is a rural locality (a selo) in Mazadinsky Selsoviet, Tlyaratinsky District, Republic of Dagestan, Russia. Population:
Geography
Rosta is located 29&nbsp;km north of Tlyarata (the district's administrative centre) by road. Niklida and Mazada are the nearest rural localities.
